import React from "react";
import { FaDownload } from "react-icons/fa";

function Resume() {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        padding: "20px",
        maxWidth: "1200px",
        margin: "auto",
      }}
    >
      <h1 style={{ color: "#839366" }}>My Resume</h1>
      <div style={{ display: "flex", alignItems: "flex-start", gap: "20px" }}>
        <iframe
          src="/resume.pdf"
          style={{ width: "60%", height: "900px", border: "none" }}
          title="Resume"
        />
        <a
          href="/resume.pdf"
          download
          style={{
            display: "flex",
            alignItems: "center",
            padding: "10px 20px",
            fontSize: "16px",
            color: "#f8f9f6",
            backgroundColor: "#4c7051",
            textDecoration: "none",
            borderRadius: "5px",
            border: "1px solid #4c7051",
            boxShadow: "0 4px 6px rgba(0,0,0,0.1)",
          }}
        >
          <FaDownload style={{ marginRight: "8px" }} />
          Download Resume
        </a>
      </div>
    </div>
  );
}

export default Resume;
